"use strict";

var _assignId = require("../assignId");

describe('assignId', () => {
  it('takes in an object and assigns it an ID, on subsequent requests, the same ID will be returned', () => {
    const foo = {};
    const bar = {};
    const baz = {};
    const fooAlias = foo;
    expect((0, _assignId.assignId)(foo)).toBe((0, _assignId.assignId)(foo));
    expect((0, _assignId.assignId)(fooAlias)).toBe((0, _assignId.assignId)(foo));
    expect((0, _assignId.assignId)(bar)).toBe((0, _assignId.assignId)(bar));
    expect((0, _assignId.assignId)(baz)).toBe((0, _assignId.assignId)(baz));
  });
});